void getChar(uint8_t Letter[], uint16_t X,uint16_t Y,Color RGBA, uint8_t depth, uint8_t S) {
 uint8_t string[1024] = {0};
 int j=0,k=0;
 for (int i=0;i<=strlen(Letter);i++) {
  if (Letter[i] == '\n' || i == strlen(Letter)) {
   memcpy(string, &Letter[j], i-j); string[i-j]=0,j=i+1;
   if (depth > 0) DrawTextEx(font, string, (Vector2){X+depth,Y+k*S*8+depth}, S*8, 0, (Color){0,0,0,sys.GUIOpacity/100.f*255});
   ImageDrawTextEx(&sys.canvas, font, string, (Vector2){X,Y+k*S*8}, S*8, 0, RGBA);
   k++;
}}}

void printBits(uint8_t byte) {
 uint8_t b,j=7;
 while(j>0) { b = (byte>>j)&1; printf("%u", b); j--; }
}

Font GenerateFont() {
 #define img_sz 128
 printf("\n%sGenerating TGR Font...\n",COLOR_MAGENTA);
 Color *pixels = (Color *)RL_CALLOC(img_sz*img_sz, sizeof(Color));
 
 //ASSEMBLE GLYPHS
 int index = 0, i=0;
 int x = 0, y = 0;
 int yPosToRead = 0, xPosToRead = 0;
 for (index = 0; index < 256; index++) {
  while (yPosToRead < 8) {
   while (xPosToRead < 8) {
    if ((TGR_fontraw[(index<135)?index:135][yPosToRead]&(128>>xPosToRead))>0) pixels[(y+yPosToRead)*img_sz+(x+xPosToRead)] = WHITE;
    xPosToRead++;
   }yPosToRead++,xPosToRead=0;
  }x+=8,yPosToRead=0; if(x==img_sz) x=0,y+=8;// if(y>img_sz) break;
 }
 
 //GEN FONT
 Font font = GetFontDefault(); 
 x = 0, y = 0;
 
 int tempCharValues[256] = {0};
 Rectangle tempCharRecs[256] = {0};
 
 index = 0, yPosToRead = 0, xPosToRead = 0;
 
 // Parse image data to get rectangle sizes
 while (yPosToRead < img_sz) {
  while (xPosToRead < img_sz) {
   tempCharValues[index] = (index<135)?TGR_chars[index]:0xFFFD;
   tempCharRecs[index].x = (float)xPosToRead;
   tempCharRecs[index].y = (float)yPosToRead;
   tempCharRecs[index].height = 8.f;
   tempCharRecs[index].width = 8.f;
   index++,xPosToRead += 8;
  }yPosToRead+=8, xPosToRead = 0;
 }
 
 Image fontClear = {pixels,img_sz,img_sz,1,PIXELFORMAT_UNCOMPRESSED_R8G8B8A8};
 font.texture = LoadTextureFromImage(fontClear);
 font.glyphCount = index;
 font.glyphPadding = 0; 
 font.glyphs = (GlyphInfo *)RL_MALLOC(font.glyphCount*sizeof(GlyphInfo));
 font.recs = (Rectangle *)RL_MALLOC(font.glyphCount*sizeof(Rectangle));
 
 for (i = 0; i < font.glyphCount; i++) {
  font.recs[i] = tempCharRecs[i];
  font.glyphs[i].value = tempCharValues[i];
  font.glyphs[i].offsetX = 0;
  font.glyphs[i].offsetY = 0;
  font.glyphs[i].advanceX = 0;
  font.glyphs[i].image = ImageFromImage(fontClear, tempCharRecs[i]);
 }font.baseSize = 8;
 
 UnloadImage(fontClear);
	 printf("\\%s%sFont has been Generated!!%s\n\n",COLOR_BOLD,COLOR_GREEN,COLOR_BOTH_DEFAULT);
 return font;
}

